History Documentary hosted by Max Beesley, published by BBC in 2012 - English narration


Information
------------------------------

Chatsworth
Three-part documentary series detailing life of the new aristocracy over Chatsworth's entire 2011 season. For the first time ever, the palace of the peaks, Chatsworth House in Derbyshire, has opened its doors to the cameras for a whole year. It is a unique opportunity to take an in-depth glimpse of life upstairs and downstairs in the 21st century.


1)  Part 1 
The first programme joins the 12th duke and duchess as the house is being prepared to open to the public. It is the busiest time of year for the house staff and everyone has a role to play - even the duke and duchess, as they join the annual litter pick around the estate. 2011 sees the six month probation period of the youngest and very first female head guide, Heather Redmond. Will she win over the 60-strong guide team, some of whom have worked at Chatsworth since before she was born, and get the job for keeps? Chatsworth's award-winning farm shop is presided over by manager Andre Birkett. Man and boy he has worked for the family, starting in the kitchens of the house.


